<head><title>Design</title>
    <style>
        .d1,.s,.a,.t,.w,.i,.k{
            width: 40px;
            height: 40px;
            background-color:whitesmoke;
            display:inline-block;
            border-radius:5px;
        }
        .d1:hover{
            border:2px solid wheat;
            background-color:wheat;
        }
        .s{
            -webkit-animation-delay:0s;
            -webkit-animation-name: s;
            -webkit-animation-duration: 6s; 
            -webkit-animation-iteration-count: infinite;
        }
        @keyframes s{
            0%{background-color: whitesmoke;}
            100%{background-color:darkslateblue;}
        }
        .a{
            -webkit-animation-delay:1s;
            -webkit-animation-name: a;
            -webkit-animation-duration: 6s; 
            -webkit-animation-iteration-count: infinite;
        }
        @keyframes a{
            0%{background-color:whitesmoke;}
            100%{background-color:aqua;}
        }
        .t{
            -webkit-animation-delay:2s;
            -webkit-animation-name: t;
            -webkit-animation-duration: 6s; 
            -webkit-animation-iteration-count: infinite;   
        }
        @keyframes t{
            0%{background-color:whitesmoke;}
            100%{background-color:chocolate;}
        }
         .w{
            -webkit-animation-delay:3s;
            -webkit-animation-name: w;
            -webkit-animation-duration: 6s; 
            -webkit-animation-iteration-count: infinite;   
        }
        @keyframes w{
            0%{background-color:whitesmoke;}
            100%{background-color:darkcyan;}
        }
         .i{
            -webkit-animation-delay:4s;
            -webkit-animation-name: i;
            -webkit-animation-duration: 6s; 
            -webkit-animation-iteration-count: infinite;   
        }
        @keyframes i{
            0%{background-color:whitesmoke;}
            100%{background-color:brown;}
        } 
         .k{
            -webkit-animation-delay:5s;
            -webkit-animation-name: k;
            -webkit-animation-duration: 6s; 
            -webkit-animation-iteration-count: infinite;   
        }
        @keyframes k{
            0%{background-color:whitesmoke;}
            100%{background-color:blueviolet;}
        }         

    
    </style>
